import React, { Component } from "react";
import "../App.css";
import Footer from "./Footer";
import Header from "./Header";

class SignIn extends React.Component {
  // constructor(props) {
  //   super(props);
  //   this.state = { value: "" };

  // }

  // handleChange(event) {
  //   this.setState({ value: event.target.value });
  // }

  handleSubmit(event) {
    alert("Welcome+{this.state.value}  ");
    event.preventDefault();
  }

  render() {
    return (
      <div>
        <Header title="SignIn/Login" />

        <div className="signIn">
          <form onSubmit={this.handleSubmit}>
            FullName or CompanyName:
            <input
              type="text"
              // value={this.state.value}
              // onChange={this.handleChange}
            />
            <br />
            <br />
            Address:
            <input type="text" />
            <br />
            <br />
            Email:
            <input type="text" />
            <br />
            <br />
            PhoneNumber:
            <input type="number" />
            <br />
            <br />
            Password:
            <input type="password" />
            <br />
            <br />
            <button onHandleSubmit={this.handleSubmit}>SUBMIT</button>
          </form>
        </div>
        <Footer />
      </div>
    );
  }
}
export default SignIn;
